import React from "react"

function Project(props){
    const image = require("../portfolio_assets/FixGradKappa2.png")
    return(
        <div>
            <img src={image} alt="text"></img>
            <article>
                <h2 className="h2_right">{props.project.caption}</h2>
                <p className="p_right">{props.project.text}</p>
            </article>
        </div>
    )
}

export default Project
